# 4.2 Evaluation Metrics 

In biomedical image segmentation tasks, both Dice Similarity Coefficient (DSC) metric and Intersection over Union (IoU) are commonly used to evaluate the performance of the models. They provide a measure of how well the predicted segmentation aligns with the ground truth, with higher values indicating better agreement. The Dice coefficient measures the overlap between the predicted and the ground truths in image segmentation tasks. It ranges from 0 to 1 , with 1 indicating a perfect overlap and 0 indication no overlap. The Dice coefficient is calculated as twice the intersection of the predicted mask with the ground-truth divided by their sum. The Intersection over Union (IoU) quantifies the overlap between the predicted and ground truth by calculating the ratio of their intersection to their union. It also ranges from 0 to 1 , with 1 indicating a perfect match. The formulas to calculate DCS and IoU are determined as follows:

$$
\begin{gathered}
\text { DSC }=\frac{2 \times T P}{2 \times T P+F P+F N+\varepsilon} \\
\text { IoU }=\frac{T P}{T P+F P+F N+\varepsilon}
\end{gathered}
$$

In addition to DSC and IoU, Precision and Recall are two fundamental metrics widely used to evaluate the segmentation performance. Precision and Recall are expressed as follows:

$$
\begin{gathered}
\text { Recall }=\frac{T P}{T P+F N+\varepsilon} \\
\text { Precision }=\frac{T P}{T P+F P+\varepsilon}
\end{gathered}
$$

where $T P$ is the number of true positives, $F P$ is the number of false positive, $F N$ is the number of false negative and $\varepsilon$ is the denominator coefficient to avoid potential divide-by-zero.

To evaluate the segmentation performance, the F-score (also denoted as $F_{1}$ ) is used to measure the harmonic mean of precision and recall, expressed as :

$$
\text { F-score }=\frac{2 \text {.Precision } \times \text { Recall }}{\text { Precision }+ \text { Recall }}
$$

To assess the statistical significance of the segmentation results when comparing our model with others, we calculate the $p$-value using the DSC, IoU, Precision, and Recall metrics through paired $t$-tests. A $p$-value less than or equal to the threshold for significance (commonly set at 0.05 ) signifies that the results are statistically significant.
